libdata[libdataItem++] = new Array("AUXIL/correl_images.html", "correl_images.pro", '.pro file in <a href="AUXIL/dir-overview.html">AUXIL\ directory</a>', "correl_images.pro", "", "", " NAME: 	CORREL_IMAGES  PURPOSE:        Compute the 2-D cross-correlation function of two images  EXPLANATION:        Computes the 2-D cross-correlation function of two images for        a range of (x,y) shifting by pixels of one image relative to the other.   CALLING SEQUENCE:        Result = CORREL_IMAGES( image_A, image_B,                         [XSHIFT=, YSHIFT=, XOFFSET_B=, YOFFSET_B=, REDUCTION=,                         MAGNIFICATION=, /NUMPIX, /MONITOR  )   INPUTS:        image_A, image_B = the two images of interest.   OPTIONAL INPUT KEYWORDS:        XSHIFT = the + & - shift to be applied in X direction, default=7.        YSHIFT = the Y direction + & - shifting, default=7.         XOFFSET_B = initial X pixel offset of image_B relative to image_A.        YOFFSET_B = Y pixel offset, defaults are (0,0).         REDUCTION = optional reduction factor causes computation of                        Low resolution correlation of bin averaged images,                        thus faster. Can be used to get approximate optimal                        (x,y) offset of images, and then called for successive                        lower reductions in conjunction with CorrMat_Analyze                        until REDUCTION=1, getting offset up to single pixel.         MAGNIFICATION = option causes computation of high resolution correlation                        of magnified images, thus much slower.                        Shifting distance is automatically = 2 + Magnification,                        and optimal pixel offset should be known and specified.                        Optimal offset can then be found to fractional pixels                        using CorrMat_Analyze( correl_images( ) ).         /NUMPIX - if set, causes the number of pixels for each correlation                        to be saved in a second image, concatenated to the                        correlation image, so Result is fltarr( Nx, Ny, 2 ).        /MONITOR causes the progress of computation to be briefly printed.   OUTPUTS:        Result is the cross-correlation function, given as a matrix.   PROCEDURE:        Loop over all possible (x,y) shifts, compute overlap and correlation        for each shift. Correlation set to zero when there is no overlap.   MODIFICATION HISTORY:        Written, July,1991, Frank Varosi, STX @ NASA/GSFC        Use ROUND instead of NINT, June 1995, Wayne Landsman HSTX        Avoid divide by zero errors, W. Landsman HSTX April 1996 	    Remove use of !DEBUG    W. Landsman   June 1997        Subtract mean of entire image before computing correlation, not just           mean of overlap region   H. Ebeling/W. Landsman   June 1998   ", "", "          -1", "");
  
  
  libdata[libdataItem++] = new Array("AUXIL/correl_images.html#correl_images", "correl_images", 'routine in <a href="AUXIL/correl_images.html">correl_images.pro</a>', "correl_images.pro", "", "correl_images", "", "XSHIFTYSHIFTXOFFSET_BYOFFSET_BREDUCTIONMAGNIFICATIONNUMPIXMONITORimage_Aimage_B", "          -1", "");
  
  

libdata[libdataItem++] = new Array("AUXIL/corrmat_analyze.html", "corrmat_analyze.pro", '.pro file in <a href="AUXIL/dir-overview.html">AUXIL\ directory</a>', "corrmat_analyze.pro", "", "", " NAME: 	CORRMAT_ANALYZE  PURPOSE: 	Find the optimal (x,y) offset to maximize correlation of 2 images  EXPLANATION: 	Analyzes the 2-D cross-correlation function of two images 	and finds the optimal(x,y) pixel offsets. 	Intended for use with function CORREL_IMAGES.   CALLING SEQUENCE: 	corrmat_analyze, correl_mat, xoffset_optimum, yoffset_optimum, 		max_corr, edge, plateau, [XOFF_INIT=, YOFF_INIT=, REDUCTION=, 		MAGNIFICATION=, PLATEAU_THRESH=, /PRINT]   INPUTS: 	correl_mat = the cross-correlation matrix of 2 images. 			(as computed by function CORREL_IMAGES( imA, imB ) ).   NOTE: 	If correl_mat(*,*,1) is the number of pixels for each correlation, 	(the case when /NUMPIX was specified in call to CORREL_IMAGES) 	then sqrt( sqrt( # pixels )) is used as correlation weighting factor.   OPTIONAL INPUT KEYWORDS: 	XOFF_INIT = initial X pixel offset of image_B relative to image_A. 	YOFF_INIT = Y pixel offset, (both as specified to correl_images). 	REDUCTION = reduction factor used in call to CORREL_IMAGES. 	MAGNIFICATION = magnification factor used in call to CORREL_IMAGES, 		this allows determination of offsets up to fractions of a pixel. 	PLATEAU_THRESH = threshold used for detecting plateaus in 		the cross-correlation matrix near maximum, (default=0.01), 		used only if MAGNIFICATION > 1 	/PRINT causes the result of analysis to be printed.   OUTPUTS: 	xoffset_optimum = optimal X pixel offset of image_B relative to image_A. 	yoffset_optimum = optimal Y pixel offset. 	max_corr = the maximal correlation corresponding to optimal offset. 	edge = 1 if maximum is at edge of correlation domain, otherwise=0. 	plateau = 1 if maximum is in a plateau of correlation function, else=0.   PROCEDURE: 	Find point of maximum cross-correlation and calc. corresponding offsets. 	If MAGNIFICATION > 1: 	the  correl_mat is checked for plateau near maximum, and if found, 	the center of plateau is taken as point of maximum cross-correlation.   MODIFICATION HISTORY: 	Written, July-1991, Frank Varosi, STX @ NASA/GSFC 	Use ROUND instead of NINT, June 1995 Wayne Landsman HSTX 	Remove use of non-standard !DEBUG system variable   W.L. HSTX 	Converted to IDL V5.0   W. Landsman   September 1997  ", "", "          -1", "");
  
  
  libdata[libdataItem++] = new Array("AUXIL/corrmat_analyze.html#corrmat_analyze", "corrmat_analyze", 'routine in <a href="AUXIL/corrmat_analyze.html">corrmat_analyze.pro</a>', "corrmat_analyze.pro", "", "corrmat_analyze", "", "XOFF_INITYOFF_INITREDUCTIONMAGNIFICATIONPRINTPLATEAU_THRESHcorrel_matxoffset_optimumyoffset_optimummax_corredgeplateau", "          -1", "");
  
  

